[{"name": "mcp__pubmed__search_articles", "input": {"query": "FDA approved enzyme inhibitors protein targets", "max_results": 20}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "enzyme inhibitor approved", "limit": 20}}, {"name": "mcp__pubmed__get_article_metadata", "input": {"pmids": ["41597198", "41559918", "41557625"]}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "imatinib", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "aspirin", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "atorvastatin", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX chembl: <http://rdf.ebi.ac.uk/terms/chembl#>
SELECT DISTINCT ?drug ?drugName ?target ?targetName ?mechanism
WHERE {
  VALUES ?drug { chembl_molecule:CHEMBL941 chembl_molecule:CHEMBL25 chembl_molecule:CHEMBL1487 }
  ?drug a chembl:SmallMolecule ;
        rdfs:label ?drugName .
  ?activity chembl:hasMolecule ?drug ;
            chembl:hasTarget ?target .
  ?target rdfs:label ?targetName .
  OPTIONAL {
    ?mechanism chembl:hasMolecule ?drug ;
               chembl:hasTarget ?target ;
               chembl:mechanismOfAction ?moa .
  }
}
LIMIT 100"}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "kinase inhibitors FDA approved protein targets cancer", "max_results": 10}}, {"name": "mcp__pubmed__get_article_metadata", "input": {"pmids": ["41604371", "41587611", "41507154"]}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "protease inhibitors HIV FDA approved targets", "max_results": 10}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "ACE inhibitors angiotensin converting enzyme hypertension", "max_results": 10}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "statin HMG-CoA reductase inhibitor cholesterol", "max_results": 5}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "PDE5 phosphodiesterase inhibitors sildenafil tadalafil", "max_results": 5}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "SGLT2 inhibitors sodium glucose cotransporter diabetes", "max_results": 5}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "DPP4 inhibitors dipeptidyl peptidase diabetes", "max_results": 5}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "aromatase inhibitors anastrozole letrozole breast cancer", "max_results": 5}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "cyclooxygenase COX-2 inhibitors celecoxib NSAIDs", "max_results": 5}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "PARP inhibitors olaparib DNA repair cancer", "max_results": 5}}]

[{"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human kinase phosphate transfer", "limit": 20}}, {"name": "mcp__ols__searchClasses", "input": {"query": "phosphate transfer", "pageSize": 20}}, {"name": "mcp__togomcp__search_rhea_entity", "input": {"query": "phosphate transfer", "limit": 20}}, {"name": "mcp__ols__searchClasses", "input": {"query": "kinase activity phosphorylation", "pageSize": 10}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?goTerm ?goLabel
WHERE {
  ?protein a up:Protein ;
           up:organism <http://purl.uniprot.org/taxonomy/9606> ;
           up:enzyme ?enzyme ;
           up:classifiedWith ?goTerm .
  ?enzyme up:catalyticActivity ?activity .
  ?activity rdfs:comment ?comment .
  FILTER(CONTAINS(?comment, "phosphate"))
  ?goTerm rdfs:label ?goLabel .
  FILTER(CONTAINS(STR(?goTerm), "GO_"))
}
LIMIT 50"}}, {"name": "mcp__ols__fetch", "input": {"id": "go+http://purl.obolibrary.org/obo/GO_0016772"}}, {"name": "mcp__ols__searchClasses", "input": {"query": "protein phosphorylation", "ontologyId": "go", "pageSize": 15}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human protein kinase ATP phosphorylation", "limit": 10}}, {"name": "mcp__ols__fetch", "input": {"id": "go+http://purl.obolibrary.org/obo/GO_0006468"}}, {"name": "mcp__ols__getDescendants", "input": {"ontologyId": "go", "classIri": "http://purl.obolibrary.org/obo/GO_0006468", "pageSize": 30}}, {"name": "mcp__ols__searchClasses", "input": {"query": "signal transduction phosphorylation", "ontologyId": "go", "pageSize": 10}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX ddbj: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>
PREFIX faldo: <http://biohackathon.org/resource/faldo#>

SELECT DISTINCT ?gene ?gene_name ?product ?protein_id
WHERE {
  ?entry a ddbj:Entry ;
         ddbj:organism ?organism ;
         ddbj:feature ?feature .

  FILTER(CONTAINS(LCASE(?organism), "escherichia coli"))

  ?feature a ddbj:CDS ;
           ddbj:gene ?gene_name ;
           ddbj:product ?product .

  OPTIONAL { ?feature ddbj:protein_id ?protein_id }

  BIND(?feature as ?gene)
}
LIMIT 50
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?type
WHERE {
  ?s a ?type .
}
LIMIT 100
"}}, {"name": "mcp__togomcp__list_databases", "input": {}}, {"name": "mcp__togomcp__get_graph_list", "input": {"dbname": "ddbj"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "
PREFIX insdc: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>
PREFIX taxid: <http://identifiers.org/taxonomy/>
PREFIX faldo: <http://biohackathon.org/resource/faldo#>

SELECT DISTINCT ?gene_name ?product ?protein_id
WHERE {
  ?entry a insdc:Entry ;
         insdc:organism taxid:562 ;
         insdc:feature ?feature .

  ?feature a insdc:CDS .

  OPTIONAL { ?feature insdc:gene ?gene_name }
  OPTIONAL { ?feature insdc:product ?product }
  OPTIONAL { ?feature insdc:protein_id ?protein_id }

  FILTER(BOUND(?gene_name) || BOUND(?product))
}
LIMIT 100
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "
PREFIX insdc: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>
PREFIX taxid: <http://identifiers.org/taxonomy/>

SELECT ?entry ?organism
WHERE {
  ?entry a insdc:Entry ;
         insdc:organism ?organism .
  FILTER(STRSTARTS(STR(?organism), "http://identifiers.org/taxonomy/562"))
}
LIMIT 10
"}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "gene", "query": "Escherichia coli[organism] AND complete genome", "max_results": 20}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "gene", "ids": ["944786", "947567", "948488", "948297", "945829", "944821", "945641", "948487", "947794", "944790"]}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "ftsZ Escherichia coli K-12", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ncbigene", "sparql_query": "
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX ncbigene: <http://identifiers.org/ncbigene/>

SELECT ?gene ?symbol ?description ?protein
WHERE {
  VALUES ?gene { ncbigene:944786 ncbigene:947567 ncbigene:948488 ncbigene:948297 ncbigene:945829 }

  OPTIONAL { ?gene rdfs:label ?symbol }
  OPTIONAL { ?gene dcterms:description ?description }
  OPTIONAL { ?gene dcterms:relation ?protein }
}
LIMIT 50
"}}, {"name": "mcp__togomcp__togoid_convertId", "input": {"ids": "944786,947567,948488,948297,945829,944821,945641,948487,947794,944790", "route": "ncbigene,uniprot", "limit": 100}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?protein ?accession ?proteinName ?geneName ?function
WHERE {
  VALUES ?accession { "P0A9A6" "P0ABQ4" "P10408" "P21513" "P0ACF8" "P00579" "P0A7Z4" "P0AG30" "P0A8T7" "P0A8V2" }

  ?protein a up:Protein ;
           up:reviewed true ;
           up:mnemonic ?accession ;
           up:recommendedName ?recName .

  ?recName up:fullName ?proteinNameLiteral .
  BIND(STR(?proteinNameLiteral) AS ?proteinName)

  OPTIONAL {
    ?protein up:encodedBy ?gene .
    ?gene skos:prefLabel ?geneNameLiteral .
    BIND(STR(?geneNameLiteral) AS ?geneName)
  }

  OPTIONAL {
    ?protein up:annotation ?annotation .
    ?annotation a up:Function_Annotation ;
                rdfs:comment ?functionLiteral .
    BIND(STR(?functionLiteral) AS ?function)
  }
}
LIMIT 50
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX uniprotkb: <http://purl.uniprot.org/uniprot/>

SELECT DISTINCT ?protein ?proteinName ?geneName ?function
WHERE {
  VALUES ?protein { uniprotkb:P0A9A6 uniprotkb:P0ABQ4 uniprotkb:P10408 uniprotkb:P21513 uniprotkb:P0ACF8 }

  ?protein a up:Protein ;
           up:reviewed true ;
           up:recommendedName ?recName .

  ?recName up:fullName ?proteinNameLiteral .
  BIND(STR(?proteinNameLiteral) AS ?proteinName)

  OPTIONAL {
    ?protein up:encodedBy ?gene .
    ?gene rdfs:label ?geneNameLiteral .
    BIND(STR(?geneNameLiteral) AS ?geneName)
  }

  OPTIONAL {
    ?protein up:annotation ?annotation .
    ?annotation a up:Function_Annotation ;
                rdfs:comment ?functionLiteral .
    BIND(STR(?functionLiteral) AS ?function)
  }
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX uniprotkb: <http://purl.uniprot.org/uniprot/>

SELECT DISTINCT ?protein ?proteinName ?geneName ?function
WHERE {
  VALUES ?protein { uniprotkb:P00579 uniprotkb:P0A7Z4 uniprotkb:P0AG30 uniprotkb:P0A8T7 uniprotkb:P0A8V2 }

  ?protein a up:Protein ;
           up:reviewed true ;
           up:recommendedName ?recName .

  ?recName up:fullName ?proteinNameLiteral .
  BIND(STR(?proteinNameLiteral) AS ?proteinName)

  OPTIONAL {
