    BIND(STR(?functionLiteral) AS ?function)
  }
}
"}}]

[{"name": "mcp__ols__searchClasses", "input": {"query": "NANDO", "ontologyId": "nando", "pageSize": 1}}, {"name": "mcp__ols__listOntologies", "input": {"lang": "en"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX owl: <http://www.w3.org/2002/07/owl#>

SELECT (COUNT(DISTINCT ?disease) AS ?count)
WHERE {
  ?disease a owl:Class .
  FILTER(STRSTARTS(STR(?disease), "http://nanbyodata.jp/ontology/nando#"))
}"}}, {"name": "WebSearch", "input": {"query": "NANDO ontology intractable diseases Japan number of terms 2026"}}, {"name": "mcp__ols__searchClasses", "input": {"query": "intractable disease", "ontologyId": "nando", "pageSize": 100}}, {"name": "mcp__togomcp__list_databases", "input": {}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
